import { Component } from "react";

export class userProfile extends Component {
  constructor(props) {
    super(props);

    this.refreshlist = this.refreshlist.bind(this);

    this.state = {
      userData: [],
      agmUnit: "",
      dgmUnit: "",
      serviceUnit: "",
      username: "",
    };
  }

  componentDidMount() {
    this.refreshlist();
  }

  refreshlist() {}

  render() {
    const { userData, agmUnit, dgmUnit, serviceUnit, username } = this.state;

    return <div className="container"></div>;
  }
}
